    <div>
    <p class=MsoNormal align=center style='text-align:center'><span
    style='mso-ascii-font-family:Arial;mso-hansi-font-family:Arial;mso-bidi-font-family:
    Arial;color:#4D5156;background:white'>Europa&nbsp;</span><span
    style='mso-ascii-font-family:Arial;mso-hansi-font-family:Arial;mso-bidi-font-family:
    Arial;color:#040C28;background:#D3E3FD'>es un continente del hemisferio norte,
    el segundo más pequeño del mundo y el tercero más poblado<o:p></o:p></span></p>
    <span style='font-variant-ligatures: normal;font-variant-caps: normal;
    orphans: 2;text-align:start;widows: 2;-webkit-text-stroke-width: 0px;
    text-decoration-thickness: initial;text-decoration-style: initial;
    text-decoration-color: initial;float:none;word-spacing:0px'>
    <p class=MsoNormal align=center style='text-align:center'><span
    style='mso-ascii-font-family:Arial;mso-hansi-font-family:Arial;mso-bidi-font-family:
    Arial;color:#4D5156;background:white'>&nbsp;</span>Europa es el segundo
    continente más pequeño del mundo, solo por detrás de Oceanía. Tiene una
    superficie de 10 359 358 km²,&#8203; lo que representa el 6,8% de las
    tierras emergidas. A finales de 2016 estaba compuesta por cincuenta países,
    incluyendo Rusia y Turquía, aunque la mayor parte de sus territorios sean
    asiáticos.<b style='mso-bidi-font-weight:normal'><span style='font-size:
    36.0pt;mso-bidi-font-size:11.0pt;line-height:105%'><o:p></o:p></span></b></p>
    </span></div>
